import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import ImageAnnotation from '../components/image-annotation';
import { methods, samplePayload } from '../components/image-annotation/payload';
import { AnnotationType } from '../types';

const ImageAnnotationComp: React.FC = withConnect({ type: AnnotationType.IMAGE, methods, samplePayload })(ImageAnnotation);

ReactDOM.render(
  <ImageAnnotationComp />,
  document.getElementById('root'),
);

serviceWorker.unregister();
